import { makeStyles } from "@material-ui/core";
export default makeStyles((theme)=>({
    cart:{
        maxWidth : '600px',
        paddingTop : '20px',
        minWidth:'100%',
        maxHeight: '100%',
        backgroundColor:'#f0ffff',

    },
    button:{
        top : '20px',
        right : '20px',
        position : 'fixed',
    }
}));
